import logo from "./logo.svg";
import "./App.css";
import { Switch } from "react-router-dom";

function App() {
  return (
    <div className="App">
      <Switch>
        <Route path="/register">
          <Register />
        </Route>
        <Route path="/login">
          <Login />
        </Route>
        <Route path="/perfil">
          <Perfil />
        </Route>
        <Route path="/">
          <ChatRoom people={people} render={render} />
        </Route>
      </Switch>
    </div>
  );
}

export default App;
